import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component
{
  constructor()
  {
    super();
    this.state = {
      string: 'Hello my name is Ankit Kapoor'
    };

  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.string}
          </p>

        </header>
      </div>
    );
  }
}

export default App;
